import React from 'react'

export default function Func(props) {


    let contenu="";

    if (props.pth="/"){
           contenu= props.pr.map((it) => 
                <li>{it.title}</li>
                )
        }

    if (props.pth="PremierAcCours"){
            contenu= props.pr.map((it) => 
            <li>{it.title}</li>
        )
        }
    

  return (
    <div>
      <div>
        
        <div class="list-type5 mt-5">
          <ol>
            
                 {contenu}
          </ol>
        </div>
      </div>
    </div>
  )
}
